import { Typography, Button, Container } from "@material-ui/core";
import useStyles from './styles';

const Contact = () => {

    const classes = useStyles();

	return (
		<Container className={classes.contact}>
            <div>
			<Typography variant="caption">
				What's in your imagination
			</Typography>
			<Typography variant="h3">Lets talk about you</Typography>
			<Typography variant="h5">
				Have the next disruptive idea in mind or just want to chat, feel
				free to get i touch with me. Im that easy. Currently my time
				books quick so the sooner you write the better for both of us
			</Typography>
			<Typography variant="caption">Reply within 2 working days</Typography>
            <br />
            <Button>lumungep12@gmail.com</Button>
            </div>
            <div>
                <Typography variant="h4">My Packages</Typography>
            </div>
		</Container>
	);
};

export default Contact;
